INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24015, 24, "2019/07/31 12:00:00", 1, 4, "カオリ（サマー）", "2030/12/17 14:59:59", 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 10021, 0.0, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24016, 24, "2019/07/31 12:00:00", 2, 4, "カオリ（サマー）", "2030/12/17 14:59:59", 1, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 10021, 4.0, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24017, 24, "2019/07/31 12:00:00", 3, 4, "カオリ（サマー）", "2030/12/17 14:59:59", 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 10021, 0.0, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24018, 24, "2019/07/31 12:00:00", 4, 1, "カオリ（サマー）", "2030/12/17 14:59:59", 2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 10021, 5.2, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24019, 24, "2019/07/31 12:00:00", 5, 5, "カオリ（サマー）", "2030/12/17 14:59:59", 6, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 10021, 4.2, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24020, 24, "2019/07/31 12:00:00", 6, 2, "カオリ（サマー）", "2030/12/17 14:59:59", 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 10021, 0.0, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24021, 24, "2019/07/31 12:00:00", 7, 1, "カオリ（サマー）", "2030/12/17 14:59:59", 6, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 10021, 6.4, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24022, 24, "2019/07/31 12:00:00", 8, 2, "カオリ（サマー）", "2030/12/17 14:59:59", 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 10021, 0.0, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24023, 24, "2019/07/31 12:00:00", 9, 6, "カオリ（サマー）", "2030/12/17 14:59:59", 3, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 10021, 10.08, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24024, 24, "2019/07/31 12:00:00", 10, 1, "カオリ（サマー）", "2030/12/17 14:59:59", 2, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 10021, 5.0, 0.0, 0.0);
INSERT INTO `v1_4942e948b592abd6a511e5b4b3370f14788000c77ecafa831ddb5eefc34de736` VALUES (110501, 24025, 24, "2019/07/31 12:00:00", 11, 2, "カオリ（サマー）", "2030/12/17 14:59:59", 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 10021, 0.0, 0.0, 0.0);
